import React from 'react';
import './Footer.css';
import {Link} from "react-router-dom";

function Footer() {
    return(
        <footer id="Footer_site">
            <div className="container">
                <div className="row">
                    <div className="col-md-6">
                        <Link to="/">
                            <img src="" alt=""/>
                        </Link>
                    </div>
                    <div className="col-md-6">

                    </div>
                </div>
            </div>
        </footer>
    )
}
export default Footer;
